import React from "react";
import { styled } from "@mui/system";
import { Button } from "@mui/material";

const StyledButton = styled(
  Button,
  {}
)({
  color: "primary",
  backgroundColor: "none",
});

export default function AboutPageButton(text) {
  return (
    <>
      <StyledButton disableRipple={true} style={{ background: "transparent" }}>
        {text}
      </StyledButton>
    </>
  );
}
